import React, { Component } from "react";
import axios from 'axios';
import "./Css/Addpage.css";
class Addpage extends Component {
  
  handleSubmit(event) {
    event.preventDefault();
    const data = new FormData(event.target);
    //console.log(data)
    //console.log("value",data.get('name'))

    var obj ={
        name:data.get('name'),
        email:data.get('email'),
       qualification:data.get('qualification'),

    };
    document.querySelector(".loading-overlay").classList.remove("hidden");

    axios.post("http://localhost:5000/" , obj).then((res)=>{
     
      document.querySelector('.loading-overlay').classList.add('hidden');
      event.target.closest(".overlay").classList.add("hidden");
      //console.clear()
      //console.log(res.data)
    });
   // window.location.href = window.location.origin;
    
  }

  render() {


    return (
    //  <form>
    <form onSubmit={this.handleSubmit} autoComplete="off">
      
     <div className='loading-overlay hidden'>
       <p>Adding Student Data...</p>
       </div>
      <div className="Add-user">
    
        <button type="button"  className="close-btn" title="close">&times;</button>
       
      <div className="form" >
     
        <div className="Detail-requried">
        <label>Name*<spam class="ast"></spam></label>
          <input type="text" name="name" id="name" placeholder="Name" required
          autoComplete="false"/>
          </div>
          <div className="Detail-requried">
          <label>Email*</label>
          <input type="text" name="email" id="name" placeholder="Email" required 
          autoComplete="false" />
          </div>
          <div className="Detail-requried">
          <label>Qualification</label>
          <input type="text" name="qualification" id="name" placeholder="Qualification" required
          autoComplete="false"/>

          </div>

          <div className="reset-save Detail-requried">
          <button className="btn">Submit</button>
                  <div>
                      <button type="reset" className="btn1">Reset</button>
                  </div>
              </div>
        </div>
        </div>
         </form>
         
    );
  }
}

export default Addpage;
